(64, '2018-07-24 14:55:09', 'Wireless Earbuds', 'info@bluetooth-hat.ltd', 'Check out nowhttps://www.bluetooth-hat.ltd/TWS9100-Waterproof-TWS-Bluetooth-Earphone-Wireless--Earbuds-3D-Stereo-sport-running-With-charge-box-Microphone-Auto-charging\r\nEmail: info@bluetooth-hat.ltd\r\n\r\nWiFun Touch Waterproof Wireless Earbuds Bluetooth 9100\r\n\r\nThe left and right earbud can use separately and together\r\n\r\nMulti-function button with unique silicone caps\r\nThe WiFun wireless headset designed to only be with one button, the multi-function button can finish the call answer, bluetooth pairing, power on and power off, pretty easy to use. \r\nThe unique silicone caps is very suit ears structure. Super comfortable, anti-allergy and secure, no need worry about pain and fall off during long time wearing or doing sports.\r\nUnique magnet design- ensure closing securely ; Antioxidant gold-plating contactor- keep efficient charging\r\n\r\nHow to Pair it:\r\n\r\n1, Hold down left and right mini earbuds together until two indicators light flash red and blue alternately. (Only when they flash red and blue, does mean earbuds go into pairing mode). \r\n2, Wait for another 5 to 10s, one indicator light will stop flash red and blue while another one still flashes red and blue alternately. (It means earbuds pairs with each other successfully.) \r\n3, Search JH-S9100 and pair it on your phone. \r\nSpecification\r\n\r\nMusic playtime: 2.5-3.5 hours\r\nTalk time: about 4-5 hours\r\nCharging time: about 40mins\r\nStandby time: 125 hours\r\nBluetooth version: V4.1+EDR\r\nBattery: lithium-polymer 45mAh*2\r\nPackage included:\r\n\r\n1 X WiFun K9100 Touch Wireless Earbuds\r\n1 X Charging Dock \r\n1 X Micro USB Charging Cable\r\n1 X English Manual\r\n3 X Ear Tips: Small, Medium, Large'),
